/**
 * Represents a tag for an item in your company's product catalog.
 * @export
 * @interface ItemTagDetailModel
 */
export interface ItemTagDetailModel {
    /**
     * @type {number}
     * @memberof ItemTagDetailModel
     */
    itemTagDetailId?: number;
    /**
     * @type {number}
     * @memberof ItemTagDetailModel
     */
    tagId?: number;
    /**
     * @type {string}
     * @memberof ItemTagDetailModel
     */
    tagName: string;
    /**
     * @type {number}
     * @memberof ItemTagDetailModel
     */
    itemId?: number;
    /**
     * @type {number}
     * @memberof ItemTagDetailModel
     */
    companyId?: number;
    /**
     * @type {Date}
     * @memberof ItemTagDetailModel
     */
    createdDate?: Date;
}
